import React from 'react';

const Myweek = (props) => {

    const my_days = props.days;


    return (
        <div>
            {
                my_days.map((days, index) => {
                    console.log(days);
                    return (<div key={index}>{days}</div>);
                })

            }
        </div>
    )
}

export default Myweek;
